import { CurrencyPipe } from '@angular/common';
import { Component, inject, OnInit } from '@angular/core';
import { FormBuilder, FormControl, FormGroup, Validators } from '@angular/forms';
import { ActivatedRoute } from '@angular/router';
import { Brand } from '@models/brand.model';
import { CategoryView } from '@models/categories';
import { Product } from '@models/product.model';

enum TITLE_ENUM {
  CRIAR = 'Criar Produto',
  EDITAR = 'Editar Produto'
}

@Component({
  selector: 'app-stock-form',
  templateUrl: './stock-form.component.html',
  styleUrls: ['./stock-form.component.scss']
})
export class StockFormComponent implements OnInit {

  private readonly route = inject(ActivatedRoute);
  private readonly fb = inject(FormBuilder);
  private currencyPipe = inject(CurrencyPipe);
  private produtoId!: string;

  title = '';
  isVisibleControlId = true;
  isDisabledButtonSubmit = true;
  formProduct!: FormGroup;

  fakeProducts$: Product[] = [
    {
      id: 10001,
      description: 'Cassete Tit√¢nio MBT 11s',
      active: true,
      brand: { id: 1001, name: 'KCNC' },
      category: { id: 1001, name: 'Cassetes' },
      quantity: 10,
      vlrPurchase: 320.52,
      vlrSales: 968.9,
      image: 'data:image/jpeg;base64,',
      dtCreation: new Date().toISOString()
    }
  ];

  fakeBrands: Brand[] = [
    {
      id: 1001,
      name: 'Kcnc'
    },
    {
      id: 1002,
      name: 'Shimano'
    },
    {
      id: 1003,
      name: 'Campagnolo'
    }
  ]
  fakeCategories: CategoryView[] = [
    {
      id: 1001,
      name: 'Cassetes'
    },
    {
      id: 1002,
      name: 'Desviadores Dianteiros'
    },
    {
      id: 1003,
      name: 'Desviadores Traseiros'
    }
  ]

  ngOnInit(): void {
    this.createFormStock();
    this.checkRouteParameter();
    this.formProduct.statusChanges.subscribe(status => {
      if (status === 'VALID') {
        this.isDisabledButtonSubmit = false;
      } else {
        this.isDisabledButtonSubmit = true;
      }
    })
  }

  private createFormStock(): void {
    this.formProduct = this.fb.group({
      id: new FormControl({ value: 0, disabled: true }),
      description: new FormControl('', [Validators.required, Validators.minLength(5)]),
      brand: new FormControl('', [Validators.required]),
      category: new FormControl('', [Validators.required]),
      quantity: new FormControl(null, [Validators.required, Validators.min(0)]),
      purchase: new FormControl(null, [Validators.required, Validators.min(0)]),
      sales: new FormControl(null, [Validators.required, Validators.min(0)]),
      active: new FormControl(true, [Validators.required]),
      image: new FormControl(null, [Validators.required]),
    });
  }

  onSubmit(): void { }

  private checkRouteParameter(): void {
    this.route.params.subscribe(params => {
      if (params['id']) {
        this.produtoId = params['id'];
        this.title = TITLE_ENUM.EDITAR;
        this.isVisibleControlId = true;
        this.getBrand(this.produtoId);
      } else {
        this.title = TITLE_ENUM.CRIAR;
      }
    })
  }

  private getBrand(id: string): void {
    const product = this.fakeProducts$.find(f => f.id === +this.produtoId)
    if (product)
      this.loadDataForEditing(product);
  }

  private loadDataForEditing(item: Product): void {
    this.formProduct.patchValue({
      ...item,
      sales: item.vlrSales,
      purchase: item.vlrPurchase,
      brand: item.brand.id,
      category: item.category.id
    })
  }

  formatCurrency(field: string) {
    const value = this.formProduct.get(field)?.value;
    const formattedValue = this.currencyPipe.transform(value, 'BRL', 'symbol', '1.2-2');
    this.formProduct.get(field)?.setValue(formattedValue, { emitEvent: false });
  }
}
